style.css:
/* i really want this to be global */

body {

    background-color: #0b1442;

}

#header {

    box-shadow: none;

    background: #0e1328;

}

.logbox {
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    padding: 5px;
}

.logitem {

    padding: 0;

    margin: 3px 0;

}

.strangermsg .msgsource, .youmsg .msgsource {

    display: none;

}

.strangermsg .msgsource + span, .youmsg .msgsource + span {

    display: block;

    width: max-content;

    max-width: 90%;

    padding: 8px 16px;

    background: #eee;

    border-radius: 16px;

    line-height: 16px;

}

.strangermsg .msgsource + span {

    background: #3e3e3e;

    color: #eee;

}

.youmsg .msgsource + span {

    background: #588c4d;

    margin-left: auto;

    color: #eee;

}

#tagline img {
  display: none;
}

#logo img, #logo canvas {
	display: none;
}

#logo {
	width: 236px;
	height: 57px;
	position: relative;
}

#logo::after {
	content: 'Omegle';
	line-height: 57px;
	text-align: center;
	position: absolute;
	display: block;
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	color: rgb(255, 127, 0);
	font-size: 2.3em;
}

.logwrapper {
  background-image: url("data:image:/jpg;base64,");
  background-color: #0e2e42;
  background-size: 20%;
  border: solid 2px #0c3344;
}

.logtopicsettings label {
  color: #fff;
  text-shadow: 0 0 5px #000;
}
.logtopicsettings a {
  background: #76a6ff;
  padding: 3px 2px;
  border-radius: 3px; 
  color: #333;
  font-weight: bold;
  transition: all .15s ease-in-out;
}
.logtopicsettings a:hover {
  color: #666;
}
.logsavelinks a {
  color: #83ff8a;
}
.statuslog {
  color: #fff;
  text-shadow: 0 0 5px #000;
}
